  return (
    <div
      className="home"
      css={css`
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
        height: 100vh;
        background-color: cadetblue;
        overflow: hidden;
      `}
    >
      <h1
        css={css`
          font-size: 3rem;
          color: white;
        `}
      >
        Bockscar Device Tracker Home Page
      </h1>
    </div>
  );
};
export default HomePage;
